import React from "react";
import Card from './Cards'
import './index.css'
import sdata from './sdata'

function App(){
    return (
    <>
        <h1 className="heading_style">List of top 5 Netflix Series...</h1>

        {sdata.map( ( val ) => {

            <Card imgsrc = {sdata[0].imgsrc}
            title = {sdata[0].title}
            sname = {sdata[0].sname}
            link =  {sdata[0].link}/>

        })}

    </>
    )
}


export default App;
